import React, { useState, useRef } from 'react';
import axios from 'axios';
import { Line } from 'react-chartjs-2';

const Results = () => {
  const [dataLists, setDataLists] = useState([]);
  const chartRef = useRef(null); // Add this line to create a ref

  const generateDataLists = async () => {
    try {
      const response = await axios.post('/f1score');
      console.log(response.data);
      if (response.data.success) {
        setDataLists(response.data.lists);
      }
    } catch (error) {
      console.error(error);
    }
  };

  const chartData = {
    labels: dataLists.length > 0 ? dataLists[0].map((_, index) => `Epoch ${index + 1}`) : [],
    datasets: dataLists.map((list, index) => ({
      label: `Data List ${index + 1}`,
      data: list,
      backgroundColor: `rgba(75, 192, 192, 0.2)`,
      borderColor: `rgba(75, 192, 192, 1)`,
      borderWidth: 2,
    })),
  };

  const chartOptions = {
    scales: {
      y: {
        beginAtZero: true,
      },
    },
  };

  const destroyChart = () => {
    if (chartRef.current && chartRef.current.chartInstance) {
      chartRef.current.chartInstance.destroy(); // Destroy the previous chart instance
    }
  };

  return (
    <div className="grid-dropdown">
      <button onClick={generateDataLists}>Generate Data Lists</button>

      {dataLists.length > 0 && (
        <div className="chart-container">
          {destroyChart()} {/* Call destroyChart() to destroy the previous chart */}
          <Line ref={chartRef} data={chartData} options={chartOptions} />
        </div>
      )}
    </div>
  );
};

export default Results;
